INSERT INTO `news` (`id`, `title`, `content`, `updated`, `added`, `year_id`, `texy`) VALUES
(21, 'Web spuštěn!', 'Web turnaje MINICUP pro rok 2015 byl oficiálně spuštěn! Přesně za měsíc to vypukne. Ptáte se co? No přeci turnaj miniházené dvou věkových kategorií po 12 týmech - čeká nás tedy velká porce zápasů rozdělená do tří dnů od **22. do 24. května 2015**. Bližší informace k turnaji jsou k nalezení v sekci  "informace":[Homepage:informations].', '2015-04-30 22:22:23', '2015-04-22 21:36:32', 1, 1),
(22, 'Novinky na webu', 'Nově budete moci na našem portálu během turnaje sledovat vývoj pořadí každého týmu po každém jeho zápase, ale i "přehledy":[Stats:default mladsi] se statistickými daty. Vylepšeny jsou také fotogalerie, na přehledu každého týmu budou během turnaje přibývat aktuální fotky vázající se přímo na tým. To všechno a ještě více již za týden, **těšíme se na vás!**', '2015-05-15 21:01:18', '2015-05-15 23:01:18', 1, 1),
(23, 'Pár hodin do startu', 'Turnaj se na mám pomalu blíží! Hřiště jsou nachystaná, organizátoři natěšení, vše je připraveno na velkou porci zápasů, jejichž rozlosování najdete v sekci  "zápasy":[Match:list mladsi] . První zápasy již ve 13 hodin!', '2015-05-22 09:20:33', '2015-05-22 10:38:18', 1, 1),
(24, 'Turnaj zahájen!', 'Tak už to začalo! Jak na hale, tak i na Sokolovně se nám rozběhly první zápasy!', '2015-05-23 21:12:37', '2015-05-22 13:00:07', 1, 1),
(25, 'Změna hracího času', 'Došlo k malé organizační změně v času odehrání čtyř utkání. Utkání, která se mají hrát v **sobotu v 9:00 budou odehrána již dnes, v pátek, v 18:00.** Celý sobotní program je tedy posunut o půlhodinu zpět, tzn. **zápasy, které se mají hrát v 9:30 se budou hrát v 9:00 a ostatní se také posunou** Doufáme, že vám tato změna nezpůsobí komplikace. Házené zdar!', '2015-05-22 12:40:25', '2015-05-22 14:34:11', 1, 1),
(26, 'Data aktualizována!', 'Po pátečním dni jsme na stránkách kompletně aktualizovali data a také odstranili technickou závadu, kvůli které nebyly vidět výsledky kategorie starší. Již je vše v pořádku, po prvním turnajové dni vévodí kategorii mladší tým "Nové Bránice":[Team:detail mladsi, nove-branice], ve starších družstvo "Sokolu Telnice":[Team:detail starsi, sokol-telnice]. Upozorňujeme na **posunutí zítřejších zápasů, zítra jsou zápasy posunuty o půlhodinu dříve** - v sekci "zápasy mladší":[Match:list mladsi] si můžete prohlédnout aktuální rozlosování mladší kategorie, v sekci "zápasy starší":[Match:list starsi]. ', '2015-05-22 20:46:48', '2015-05-22 21:28:15', 1, 1),
(27, 'Dnešní zápasy za námi!', 'Dnešní zápasy jsou již úspěšně odehrány. Za malou chvíli začíná exhibiční utkání extraligových hráčů Tatranu Litovel na Sokolovně. Ve  "fotogalerii":[Gallery:default] si můžete prohlédnout fotky z dnešního dne. ', '2015-05-23 14:03:44', '2015-05-23 16:03:44', 1, 1),
(28, 'Sobota ukončena', 'Celý sobotní byl ukončen! Jak exhibiční utkání trenérů a rozhodčích proti extraligovému Tatranu, tak utkání mladých hvězd i vylosování tomboly! Fotogalerii vám postupně doplňujeme a společně s vámi se těšíme na zítřejší finální část letošního turnaje MINICUP 2015!', '2015-05-23 18:49:09', '2015-05-23 20:49:09', 1, 1),
(29, 'Změna hracích hřišt', 'Kvůli nepřízni počasí se kategorie starší přesouvá do haly. **Hrací čas bude zkrácen na 1x12min - na jednom hřišti se bude hrát starší kategorie a na druhém kategorie mladší.**', '2015-05-24 06:44:08', '2015-05-24 08:40:11', 1, 1),
(30, 'Ztráty a nálezy', 'U pořadatelů se nám začínají hromadit ztracené věci. Mezi nimi i svazek klíčů, sluchátka a také platební karta. K vyzvednutí u pořadatelů. ', '2015-05-24 08:47:22', '2015-05-24 10:47:22', 1, 1),
(31, 'Nedělní program v plném proudu', 'Zápasy obou kategorií probíhají v hale v naprostém pořádku, do konce turnaje a jeho vyhlášení zbývá již méně než pětina. Doporučujeme si prohlédnout sekci  "fotogalerie":[Gallery:default], kam vám vkládáme téměř akuální fotky ze hry i okolí.', '2015-05-24 09:14:07', '2015-05-24 11:14:07', 1, 1),
(32, 'Poslední siréna letošního turnaje', 'Právě zazněla poslední siréna letošního turnaje MINICUP 2015! Po krátké přestávce na sečtení výsledků a nachystání prostoru pro vyhlašování nastoupí všechny týmy v 15:30 k slavnostnímu vyhlášení výsledků!', '2015-05-24 13:01:07', '2015-05-24 15:01:07', 1, 1),
(33, 'Sláva vítězům, čest poraženým!', 'Letošní turnaj dopadl následovně, v kategorii mladší obsadilo **třetí příčku družstvo  "Velkého Meziříčí":[Team:detail mladsi, velke-mezirici], druzí byli házenkáři ze "Žeravic":[Team:detail mladsi, zeravice] a celou kategorii ovládnul tým "Nové bránice":[Team:detail mladsi, nove-branice]!**\nV kategorii starší skončili na **třetí příčce házenkáři ze "Dvora Králové n. L.":[Team:detail starsi, dvur-kralove-n-l], druhé místo vybojovali borci ze "Sokolu Telnice":[Team:detail starsi, sokol-telnice] a zvítězil tým "STM Olomouc":[Team:detail starsi, stm-olomouc]!** Gratulujeme vítězům a děkujeme všem zúčastněným hráčům, hráčkám a trenérům!', '2015-09-21 17:55:48', '2015-05-24 16:02:41', 1, 1),
(34, 'Fotogalerie doplněna!', 'Kompletně jsme vám doplnili jak fotky v sekci "fotogalerie":[Gallery:default], tak fotky na stránkách týmů. **Celkem jich je na webu úctyhodných 1407 fotek!** V nejbližších dnech přibudou i hráčské statistiky z každého zápasu.', '2015-05-25 21:23:42', '2015-05-25 23:23:42', 1, 1),
(35, 'Statistiky branek hráčů obou kategorií!', 'Do elektronické podoby jsme vám přepsali vstřelené branky všech hráčů, zatím jen pro **<a class="log" target="_blank" href="/minicup/MINICUP-2015_starsi_goly.pdf">kategorii starších</a>**. Druhou kategorii přepíšeme v následujících dnech, přeci jenom je to trochu mravenčí práce. U týmů s chybějícími jmény hráčů jsme je nebyli schopni rozluštit, a proto jsou uvedena jen čísla hráčů. \n\n**Aktualizace:** Ke stažení nyní i statistiky hráčů **<a class="log" target="_blank" href="/minicup/MINICUP-2015_mladsi_goly.pdf">kategorie mladších</a>**.', '2015-06-08 18:15:20', '2015-06-04 21:58:44', 1, 1),
(36, 'Reportáž z turnaje', 'Zde můžete shlédnout reportáž z letošního turnaje <strong>MINICUP 2015</strong>:\n\n<br>\n\n<!-- <video style="width: 100%;" src="/minicup/MINICUP-2015_reportaz-4.mp4" controls="controls">\n  Váš prohlížeč nepodporuje vkládání video souborů, soubor si budete muset\n  <a href="/minicup/MINICUP-2015_reportaz-4.mp4">stáhnout</a>.\n</video>\n\n<script>\n$(''video'').one(''play'', function () {\n        try {\n            ga("send", "event", "video", "play", $(this).attr(''src''));\n        } catch (e) {\n        }\n});\n</script> -->\n\n<iframe width="100%" height="315" src="https://www.youtube.com/embed/qOWcEXkvpSo" frameborder="0" allowfullscreen></iframe>', '2015-07-03 18:29:05', '2015-06-22 14:30:53', 1, 0),
(40, 'Za týden...', '...tak za týden(24. 5.) už bude v tuto dobu za námi několik zápasů a v plném proudu diskotéka :-) Tak se na Vás všechny už moc těšíme. :-)', '2015-09-21 18:58:42', '2013-05-17 21:25:44', 4, 0),
(43, 'První část za námi', 'Dnes bylo odehráno 18 zápasů v každé věkové kategorii, oběma kategoriím vévodí družstva Jičína, jen o skóre lepší než družstva z týmů ŠKP Bratislavy. Na třetích místech potom TJ Jiskra Otrokovice a Sokol Nové Bránice.<br />\r\nZítřejší program začíná v 9 hodin jak v hale, tak na venkovním hřišti na sokolovně.', '2015-09-21 18:58:42', '2013-05-24 21:45:48', 4, 0),
(44, 'Sobotní část', 'Druhá část MINICUPU 2013 je již v plném proudu! <br />\r\nNa venkovním hřišti již svítí sluníčko a hřiště je suché. Na hale vše probíhá bez problémů.', '2015-09-21 18:58:42', '2013-05-25 12:26:48', 4, 0),
(56, 'Odpočítáváme poslední hodiny', 'Už jen několik hodin a bude tu první mezinárodní turnaj MINI CUP 2013! Dolaďují se poslední detaily, už schází jen to počasí, tak každý ať přibalí s sebou kousek sluníčka. :-)', '2015-09-21 18:58:42', '2013-05-23 20:29:43', 4, 0),
(68, 'Překvapení ', 'V sobotu bude pro všechny hráče a hráčky přichystáno malování na obličej!<br> Již za dva dny bude zahájen MINICUP 2013, těšíme se na Vás!', '2015-09-21 18:58:43', '2013-05-22 16:05:20', 4, 0),
(69, 'Web spušten', 'Byly spuštěny stránky květnového turnaje MINI CUP 2013. Můžete se informovat o turnaji v sekci informace, podívat se na rozlosování turnaje, nebo nám poslat Váš dotaz v sekci kontakty.', '2015-09-21 18:58:43', '2013-05-09 11:25:51', 4, 0),
(72, 'MINICUP 2013 začal!', 'Zbývá 5 minut do zahájení prvních zápasů MINICUPU 2013! ', '2015-09-21 18:58:43', '2013-05-24 12:55:26', 4, 0),
(75, 'Slunečné odpoledne', 'Právě skončili poslední zápasy MINICUPU 2013 v sobotu. <br />\r\nV 16:00 nás čeká na venkovním hřišti na sokolovně zápas trenérů jednotlivých družstev a po něm zápas nejlepších hráčů z každého týmu na turnaji - zápas hvězd. ', '2015-09-21 18:58:43', '2013-05-25 15:52:48', 4, 0),
(76, 'Zápas trenérů', 'Po vyrovnaném bji zvítězilo domácí družsvo oranžových poměrem 20 ku 17. Zápas byl rozhodnut až ve vyhrocené koncovce. <br />\r\nNyní jsou na pořadí zápasy dětských hvězd v 17:00.', '2015-09-21 18:58:43', '2013-05-25 16:48:43', 4, 0),
(77, 'První poločas zápasu hvězd', 'Skončil nám první poločas zápasu dětských hvězd. V prvním poločase vyhrálo družstvo oranžových 5:2. Postihl nás menší déšť, který však již skončil a svítí nám na hřiště sluníčko.', '2015-09-21 18:58:43', '2013-05-25 17:12:34', 4, 0),
(78, 'Sobotní večer', 'Skončily zápasy dětských hvězd a tím skončil sobotní sportovní program MINICUPU! Zítra se hráči představí od 9:00 jak v hale, tak na hřišti na sokolovně.', '2015-09-21 18:58:43', '2013-05-25 18:52:50', 4, 0),
(79, 'Výsledky po sobotě', 'Po sobotě se na špici mladší i starší miniházené usadily družstva z ŠKP Bratislavy. Na druhých příčkách týmy z HBC Jičín.<br />\r\nZítřejší program začíná v 9 hodin, vyhlášení výsledků je naplánováno na 15:30.', '2015-09-21 18:58:43', '2013-05-25 22:06:28', 4, 0),
(80, 'Všechny zápasy odehrány', 'Všechny zápasy v obou kategoriích již byly odehrány a nyní se jen čeká na vyhlášení!', '2015-09-21 18:58:43', '2013-05-26 14:22:28', 4, 0),
(81, 'MINICUP 2013 je za námi!', 'Dnes byl ukončen 3-denní turnaj starší a mladší miniházené MINICUP 2013! Konečné výsledky si můžete prohlédnout v sekci &quot;Tabulky&quot;. Fotogalerie bude doplněna během následujícího týdne. <br />\r\nVšem hráčům a hráčkám děkujeme za účast a doufáme, že jste si všechny zápasy patřičně užili!', '2015-09-21 18:58:43', '2013-05-26 21:14:12', 4, 0),
(82, 'Fotogalerie', 'Byla kompletně doplněna fotogalerie z turnaje MINICUP 2013!', '2015-09-21 18:58:43', '2013-05-28 20:23:13', 4, 0),
(84, 'Start turnaje za necelý týden!', 'Házenkářský turnaj MINICUP 2014 bude odstartován za necelý týden. Již je vše nachystané, těšíme se na vás!', '2015-09-21 19:03:39', '2014-05-18 16:18:24', 2, 0),
(85, 'Příprava na Sokolovně', 'Byly přidány fotky z přípravy stanů a posezení na Sokolovně! Zároveň probíhá prezence týmů na hale, těším se na vás, turnaj začíná za necelé dvě hodiny!', '2015-09-21 19:03:40', '2014-05-23 12:20:01', 2, 0),
(86, 'Páteční zápasy v plném proudu', 'Páteční program již probíhá na plné obrátky. Už bylo odehráno několik zápasů, výsledky pro vás aktualizujeme.', '2015-09-21 19:03:40', '2014-05-23 14:54:33', 2, 0),
(87, 'Páteční část za námi', 'V sekci Tabulky již můžete najít oficiální výsledky z páteční části našeho turnaje. Také byla aktualizována fotogalerie za dnešní den.\r\nPo pátku jsou na prvních místech celky Tatran Litovel a ŠKP Bratislava. V obou případech pouze o lepší skóre nad týmy DHK Zory Olomouc a Tatranu Litovel.\r\nZítřejší program začíná v 9 hodin jak na hale, tak na Sokolovně.', '2015-09-21 19:03:40', '2014-05-23 21:08:50', 2, 0),
(88, 'Nové rozlosování', 'Na základě vašich žádosti jsme přepracovali rozlosování. Nové si již můžete prohlédnout v sekci "Tabulky"!	', '2015-09-21 19:03:40', '2014-05-02 14:55:33', 2, 0),
(89, 'MINICUP 2014 se blíží! ', '		Byl spuštěn web MINICUPU 2014! Můžete se podívat na informace o celém turnaji nebo si již prohlédnout rozlosování! Těšíme se na Vás!', '2015-09-21 19:03:40', '2014-04-08 21:17:21', 2, 0),
(90, 'Déšť', 'Zápasy starší miniházené byly bohužel přerušeny kvůli vydatnému dešti. Pokud by se nedalo hrát dnes venku, byly by zápasy starší miniházené přesunuty do haly po ukončení mladší miniházené.', '2015-09-21 19:03:40', '2014-05-24 09:54:01', 2, 0),
(91, 'Počasí se umoudřilo!', 'Vydatnou dešťovou přeháňku již máme za sebou a utkání starší miniházené pohračují na venkovním hřišti přibližne s hodinovým spožděním. Snad nám to vydrží... ', '2015-09-21 19:03:40', '2014-05-24 10:28:00', 2, 0),
(92, 'Utkání trenérů a utkání hvězd', 'Sobotní zápasový plán se nezadržitelně chýlí ke konci. Venku hraje starší miniházená již za pěkného slunečného počasí. Od 16 budou v areálu hřiště na Sokolovně probíhat exhibiční utkání trenérů a také utkání hvězd turnaje v obou kategoriích. Přiďte se podívat - zábava, počasí i dobré občerstvení je zajištěno!', '2015-09-21 19:03:40', '2014-05-24 15:01:51', 2, 0),
(93, 'Aktualizace po sobotě', 'Oficiální sobotní výsledky můžete najít aktualizované v sekci Tabulky. Také byly přidány fotky za dnešní den. Na prvních místech přenocují celky Tatranu Litovel a Velké Bystřice. Nedělní den bude ve znamení dohrávky turnaje a slavnostního vyhlášení, které se bude konat v 15:00 na hale. Těšíme se na vás!', '2015-09-21 19:03:40', '2014-05-24 22:26:47', 2, 0),
(94, 'MINICUP 2014 slavnostně ukončen', 'Před malou chvílí byl slavnostně ukončen mezinárodní turnaj miniházené MINICUP 2014 v Litovli! Kategorii mladší miniházené ovládl domácí Tatran Litovel, ve starších o vzájemný zápas vyhrála Velká Bystřice! Gratulujeme, fotky z dnešního dne pro vás připravujeme a k večeru budou v kategorii Fotogalerie.', '2015-09-21 19:03:40', '2014-05-25 17:55:58', 2, 0),
(95, 'Reportáž z letošního turnaje MINICUP 2014!', '</h3><iframe src="https://www.youtube.com/embed/tKKbzZq-5nY" style="width:100%; height:460px;"></iframe><h3>', '2015-09-21 19:03:40', '2014-08-09 22:04:20', 2, 0);
