INSERT INTO `static_content` (`id`, `slug`, `content`, `updated`) VALUES
(1, '', 'Vítejte!\r\n--------\r\n\r\nMůžete používat syntax Texy!, pokud Vám vyhovuje:\r\n- třeba **tučné** písmo nebo *kurzíva*\r\n- a takto se dělá "odkaz":http://texy.info\r\n- více najdete na stránce \r\n\r\nLook at homepage:[Team:default].\r\n\r\n\r\n"syntax":[syntax]\r\n\r\n\r\nAle také můžete zůstat u HTML:\r\n- takto <b>HTML</b>\r\n- nebo i <b class=xx>úplně <i>hloupě</b>, Texy! to pořeší\r\n\r\n\r\n[syntax]: /cs/syntax', '2015-01-24 20:49:00'),
(2, 'informations', '<div class="Article">\n<div class="Article__head Box__head">\n	<div class="Article__head__icon Box__head__icon icon__news"></div>\n	<div class="Article__head__text Box__head__text">Informace</div>\n</div>\n<div class="Box__content">\n	<div class="Article__date">Oddíl házené TJ Tatran Litovel Vás srdečně zve k účasti na 3. ročníku mezinárodního turnaje miniházené LITOVEL MINICUP 2015, který se uskuteční v termínu 22. – 24. 5. 2015.</div>\n\n<div class="Article__content">\n				Turnaj je pro určen pro družstva mladší mini (2006 a mladší) a starší mini (2004 – 2005) bez rozdílu pohlaví, tzn. chlapci, dívky, smíšené týmy. Turnaje se může zúčastnit celkem 24 týmů, z toho maximálně 12 týmů v každé věkové kategorii. \n\nVzhledem k co největší atraktivitě turnaje si pořadatel vyhrazuje právo výběru</div>\n\n<div class="Article__heading">Hrací systém:</div>\n<div class="Article__content">4 + 1, každý s každým (každý tým odehraje 11 zápasů), začátek turnaje je v pátek v 13.00 hod</div>\n\n<div class="Article__heading">Hrací doba:</div>\n<div class="Article__content">2 x 10 min s 2 min. přestávkou</div>\n\n<div class="Article__heading">Kde se hraje:</div>\n<div class="Article__content">sportovní hala ZŠ Vítězná (2 hřiště)\nvenkovní areál Sokolovna Litovel (2 hřiště)\nV případě nepřízně počasí budeme nuceni přesunout venkovní zápasy do sportovní haly, tzn. zkrácení hrací doby.</div>\n\n<div class="Article__heading">Ubytování:</div>\n<div class="Article__content">ve třídách ZŠ Vítězná – karimatka, spacák</div>\n\n<div class="Article__heading">Stravování:</div>\n<div class="Article__content">školní jídelna ZŠ Vítězná (snídaně, obědy, večeře)</div>\n\n<div class="Article__heading">Vyhodnocení turnaje:</div>\n<div class="Article__content">1. tři týmy z každé věkové kategorie obdrží pohár, hodnotnou cenu, každý hráč z týmu medaili.\nHráči všech týmů dostanou sladkou odměnu, bude vyhodnocen nejlepší střelec, hráč a brankář každé věkové kategorie</div>\n\n<div class="Article__heading">Program pro děti:</div>\n<div class="Article__content">pátek - diskotéka, sobota – zápas dětských hvězd, trenérů, doprovodný program</div>\n\n<div class="Article__heading">Program pro dospělé:</div>\n<div class="Article__content">večerní posezení v areálu Sokolovny s ochutnávkou místních specialit, doprovodný program</div>\n\n<div class="Article__heading">Doprovodný program:</div>\n<div class="Article__content">k využití volného času Vám nabízíme zajištění - vše v dosahu 300 m od ubytování <br>\nkrytý bazén s parní místností (ZŠ) <br>\nhřiště na plážový volejbal (házenou) - areál Sokolovny <br>\ntenisový kurt – areál Sokolovny <br>\nprojížďka Litovelským Pomoravím na raftech <br>\nPokud byste měli sportovního vyžití „nad hlavu“, jsme schopni Vám zarezervovat prohlídku blízkých Mladečských jeskyní nebo pohádkového hradu Bouzov (i noční prohlídku). Samozřejmě, že dopravu autobusem jsme schopni také zarezervovat.</div>\n\n<div class="Article__heading">Startovné:</div>\n<div class="Article__content">1 tým z oddílu – 1 500,- Kč, 2 týmy z oddílu 2 400,- Kč</div>\n\n<div class="Article__heading">Ubytování:</div>\n<div class="Article__content">80,- osobu/den, ubytování ve třídách ZŠ Vítězná. Bude vybírána vratná kauce 2 000,- Kč jako záloha na případné poškození vybavení tříd.</div>\n\n<div class="Article__heading">Strava:</div>\n<div class="Article__content">snídaně - 40,-\nOběd – 70,-\nVečeře – 70,-</div></div></div>', '2015-05-22 10:37:44'),
(3, 'sponsors', '	<div class="Article">\n		<div class="Article__head Box__head">\n			    <div class="Article__head__icon Box__head__icon icon__teams">\n	    </div>\n	    <div class="Article__head__text Box__head__text">Sponzoři</div>\n		</div>\n	    <div class="Box__content Sponsors__content">\n	    	<ul>\n	    	<li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n                <li class="Sponsors__sprite Box__rows"></li>\n	    	</ul>\n	    </div>\n	</div>', '2015-04-22 21:26:08'),
